import 'App.css';
import 'remixicon/fonts/remixicon.css';

import { Topbar } from 'components/Topbar';

const Market = () => {
  const [balance, setBalance] = useState(0);
  return (
    <div>
      <Topbar balance={balance} />
    </div>
  );
};

export default Market;
